import './TodoCreate.css'

const TodoCreate = () => {
    const hendleSubmit = (event) => {
        event.preventDefault()
    }
    return (
        <form className="todo-form">
            <input type="text" />
            <button type="submit">Add</button>
        </form>
    )
}

export default TodoCreate
